import React, { useState } from 'react';
import axios from 'axios';

const DoctorRegister = () => {
  const [form, setForm] = useState({
    email: '',
    full_name: '',
    password: '',
    specialization: '',
    fees: ''
  });
  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setMessage('');
    try {
      const res = await axios.post('http://localhost:8000/register_doctor', form);
      setMessage(res.data.msg || 'Registration successful!');
    } catch (err) {
      setMessage(err.response?.data?.detail || 'Registration failed');
    }
  };

  return (
    <div className="container mt-5" style={{maxWidth: 500}}>
      <h2 className="mb-4">Doctor Registration</h2>
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label>Email</label>
          <input type="email" name="email" className="form-control" value={form.email} onChange={handleChange} required />
        </div>
        <div className="mb-3">
          <label>Full Name</label>
          <input type="text" name="full_name" className="form-control" value={form.full_name} onChange={handleChange} required />
        </div>
        <div className="mb-3">
          <label>Password</label>
          <input type="password" name="password" className="form-control" value={form.password} onChange={handleChange} required />
        </div>
        <div className="mb-3">
          <label>Specialization</label>
          <input type="text" name="specialization" className="form-control" value={form.specialization} onChange={handleChange} required />
        </div>
        {/* Timings field removed */}
        <div className="mb-3">
          <label>Fees</label>
          <input type="text" name="fees" className="form-control" value={form.fees} onChange={handleChange} />
        </div>
        <button type="submit" className="btn btn-primary w-100">Register</button>
      </form>
      {message && <div className="alert alert-info mt-3">{message}</div>}
    </div>
  );
};

export default DoctorRegister;
